import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Home from './Pages/Home'
import Detail from './Pages/Detail'


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>} />
        <Route path='/items' >
          <Route index element={<Detail/>} />
          <Route path=':id' element={<Detail/>} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
